import { Component, OnInit } from '@angular/core';
import { HttpClientConfig, RxHttp } from "@rxweb/http"
import { AuthFilter } from '../filters/auth-filter';
import { Logging } from '../filters/logging-filter';
import { InMemory } from '../filters/inmemory-filter';
import { AppDomain } from '../base.component';


@Component({
    selector: 'app-methods-get',
    templateUrl: './methods-get.component.html'
})
export class MethodsGetComponent extends AppDomain implements OnInit {

    result: any

    ngOnInit() {

        HttpClientConfig.register({
            hostURIs: [{
                name: 'local',
                default: true,
                uri: 'http://localhost:53285'
            }],
            filters: [{ model: AuthFilter }, { model: Logging }, { model: InMemory, isInMemory: true }],
            onError: (r) => { console.log(r) },
            isProductionEnvironment: false
        })

        this.get({}).subscribe(x => {
            debugger;
            this.result = x
            console.log(x);
        })
    }
    
}

